import React from 'react';
import Header from "./components/header/Header"
import { Switch, Route} from 'react-router-dom';


function App() {

  return (
    <>
        <Header/>
        <main>
          <Switch>
            <Route exact/>
          </Switch>
        </main>

    </>
  );
}

export default App;
